import styled, { css } from 'styled-components';
import { MdDone, MdDelete } from 'react-icons/md';

const TodoItem = () => {
	return <Wrapper>TodoItem</Wrapper>;
};

const Wrapper = styled.div`
	display: flex;
	align-items: center;
	padding: 12px 0;
	font-family: inherit;
`;

export default TodoItem;
